import React from "react";
import { NavLink } from "react-router-dom";
import "../css/toolBar.css";
//import "@fortawesome/fontawesome-free/css/all.min.css";

function Toolbar({ isAdmin}) {
  return (
    <div className="toolbar">
      <ul className="menuBar">
        <li>
          <NavLink
            to="/application"
            exact="true"
            className={({ isActive }) => (isActive ? "my-link" : null)}
          >
            <i className="toolbar-icon fas fa-home"></i>
            Home üè°
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/application/info"
            exact="true"
            className={({ isActive }) => (isActive ? "my-link" : null)}
          >
            <i className="toolbar-icon fas fa-info-circle"></i>
            Info üë§
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/login"
            exact="true"
            className={({ isActive }) => (isActive ? "my-link" : null)}
            onClick={() => localStorage.removeItem("user")}
          >
            <i className="toolbar-icon fas fa-sign-out-alt"></i>
            Logout üö™
          </NavLink>
        </li>
        <li>
          {isAdmin && (
            <NavLink
              to="/manager-menu" // Adjust the link URL as needed
              className={({ isActive }) => (isActive ? "my-link" : null)}
            >
              <i className="toolbar-icon fas fa-cogs"></i>
              Manager Menu üõ†Ô∏è
            </NavLink>
          )}
        </li>
      </ul>
    </div>
  );
}

export default Toolbar;
